import * as actionTypes from '../const/account';

var initialState = {}
var myReducer = (state = initialState, action) => {
  switch (action.type) {

    case actionTypes.GET_CURRENT_USER:
      return action.data

    default:
      return state;
  }
}

export default myReducer;
